import React , { Component } from 'react';
import { Doughnut } from 'react-chartjs-2';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';

const styles = theme => ({
    root: {
      width: '50%',
      maxWidth: 260,
      backgroundColor: theme.palette.background.paper,
    },
    devices: {
        display: "inline-flex"
    }
  });

class NewUserData extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ChartData: {
                labels: ['New User Growth', 'Conversion Rate'],
                datasets: [
                    {
                        label: 'Population',
                        data: [
                            6.43,
                            9.43
                        ],
                        backgroundColor: [
                            '#ce2e2e',
                            '#f11ac2ba'                            
                        ]
                    }
                ]
            }
        }
    }

    render() {
        const { classes } = this.props;
        return (
            <div className="Chart-Bar">
                <Doughnut
                    data={this.state.ChartData}
                    options={{
                        maintainAspectRatio: false,
                        rotation: 1 * Math.PI,
                        circumference: 1 * Math.PI
                    }}
                />
                <Divider />
                <div className={classes.userRatio}>
                    {/* <div>
                        <h2>6.43%</h2>
                        <p>New users Growth</p>
                    </div>
                    <Divider />
                    <div>
                        <h2>9.44%</h2>
                        <p>Conversion Rate</p>
                    </div> */}
                    <List className={classes.root}>
                        <ListItem>
                        <ListItemText primary="23.2%" secondary="Desktop" />
                        </ListItem>
                        <li>
                        <Divider variant="inset" />
                        </li>
                        <ListItem>
                        <ListItemText primary="33.4%" secondary="Teblet" />
                        </ListItem>
                        <Divider variant="inset" component="li" />
                        <ListItem>
                        <ListItemText primary="44.3%" secondary="Mobile" />
                        </ListItem>
                    </List>
                </div>
            </div>
        )
    }
} 
NewUserData.propTypes = {
    classes: PropTypes.object.isRequired,
  };
  
export default withStyles(styles)(NewUserData);
